import React from 'react';
import "./About.css"
import { Row, Col } from 'react-bootstrap';

function About() {
    return (
        <div className="parallax-about">
            <Col><div className="about-header"><h1><b>About Me</b></h1></div></Col>
                <Col><div className="about-text">Started from a basic hello world program in C++ to developing web apps from scratch, I really came a long way. After graduating from Institute of Technology and Science, I got placed in TCS. During the training period I got exposed to latest technologies like Machine Learning and Deep Learning which made me fell in love with Python projects. But on the other side I always wanted to be one of the best UI developers which made me learn ReactJS and full stack by my own. You can find some of the projects under <a href="/projects"><b>Projects</b></a> page.<br></br>Do follow me on social apps, links are provided under <a href="/contact"><b>Contact</b></a> page.</div></Col>
                
            
        </div>
    );
}

export default About;
